import gps from '../../../Asset/Img/gps.png'
import voiture from '../../../Asset/Img/voiture.png'

const alt=["Logo localisation","Logo voiture"];
const srcImg=[gps,voiture];

const tabImgPresentation={
    alt:alt,
    srcImg:srcImg
}

export default tabImgPresentation;
